import React, { Component } from 'react';
import ProfileImage from './ProfileImage';

class WaveSubmit extends Component {
    render() {
        return (
            <div className = "card d-flex flex-row p-1">
                <ProfileImage
                    className = "rounded-circle"
                    width = "32"
                    height = "32"
                />
                <textarea/>   
            </div>
        );
    }
}

export default WaveSubmit;
